import React from 'react';
import PostCreate from './PostCreate';
import PostList from './PostList'; 
import image from './backround.jpg';

var sectionStyle = {
  backgroundImage: `url(${image})`
}

export default () => {
  return( 
  <div className='container' style={sectionStyle}>
      <h1>Create Post</h1>
      <PostCreate />
      <hr />
      <h1>Posts</h1>
      <PostList />
  </div>
  );
};
